%[text] 上方热图，下方统计线图
%[text] ## 语法
%[text] ```matlabCodeExample
%[text] [Layout,Axes,Lines,ColorBar]=UniExp.HeatmapLine(Data,TimeRange,Name=Value);
%[text] ```
%[text] ## 示例
%[text] ```matlabCodeExample
%[text] load +UniExp\HeatmapLine.mat
%[text] [Layout,Axes,Lines,ColorBar]=UniExp.HeatmapLine(HLData(:,[Title2,Title5]),seconds([-3,3]),XLine=XLine,YLine=YLine);
%[text] ```
%[text] ![](text:image:263d)
%[text] ## 输入参数
%[text] Data table，一行一个泳道，一列一个亚群，列名为亚群名称，可选指定行名为泳道小标题。每个单元格是(1,:,:)，第2维细胞，第3维时间。注意，这意味着Data表的两个维度与泳道热图的两个维度是转置关系。
%[text] TimeRage(1,2)duration，时间范围，两个元素分别表示回合起始时间和结束时间
%[text] ### 名称值参数
%[text] XLine timetable，调用内置xline，在每张子图上额外绘制X轴常数线。一行一条线，必须包含以下列：
%[text] - Time(:,1)duration，画线的时点
%[text] - LineStyle(:,1)string，用字符串表示的线型，详见xline文档 \
%[text] YLine table，调用内置yline，在下方统计线图上额外绘制Y轴常数线。一行一条线，必须包含以下列：
%[text] - Value(:,1)，画线的高度
%[text] - LineStyle(:,1)string，用字符串表示的线型，详见yline文档 \
%[text] EnsembleSubtitles(:,1)string，亚群标题，将用显示为ylabel。如果不指定此参数，将显示Data的列名作为亚群标题。如果指定的标题个数比亚群个数多一个，最后一个标题将显示为统计线图的ylabel。
%[text] ## 返回值
%[text] Layout(1,1)matlab.graphics.layout.TiledChartLayout，分块图布局对象，可用于后续设置全局标题、轴标签等
%[text] Axes(:,:)matlab.graphics.axis.Axes，布局中的每个坐标区对象。第1维Y轴，第2维X轴。
%[text] Lines(:,:)matlab.graphics.primitive.Patch，统计线图中的线条对象，可用于后续设置图例等。第1维亚群，第2维泳道。
%[text] ColorBar(1,1)matlab.graphics.illustration.ColorBar，颜色棒对象，可用于后续设置颜色棒标签等。
%[text] **See also** [xline](<matlab:doc xline>) [yline](<matlab:doc yline>) [ylabel](<matlab:doc ylabel>)
function [Layout,Axes,Lines,ColorBar]=HeatmapLine(Data,TimeRange,options)
arguments
	Data
	TimeRange
	options.XLine
	options.YLine
	options.EnsembleSubtitles
end
[NumLanes,NumEnsembles]=size(Data);
NumRows=NumEnsembles+1;
Layout=tiledlayout(NumRows,NumLanes,TileSpacing='tight',Padding='tight');
Axes=gobjects(NumRows,NumLanes);
Lines=gobjects(NumEnsembles,NumLanes);
HasOptions=isfield(options,["XLine","YLine","EnsembleSubtitles"]);
if HasOptions(3)
	EnsembleSubtitles=options.EnsembleSubtitles;
else
	EnsembleSubtitles=string(Data.Properties.VariableNames);
end
for E=1:NumEnsembles
	for L=1:NumLanes
		Axes(E,L)=nexttile;
		Image=permute(Data{L,E},[2,3,1]);
		imagesc(TimeRange,[1,height(Image)],Image);
		if HasOptions(1)
			arrayfun(@xline,options.XLine.Time,options.XLine.LineStyle);
		end
		Axes(E,L).XAxis.Visible=false;
	end
	ylabel(Axes(E,1),EnsembleSubtitles(E));
	yticks(Axes(E,1),[]);
	box(Axes(E,1),'off');
end
if~isempty(Data.Properties.RowNames)
	arrayfun(@title,Axes(1,:),Data.Properties.RowNames.');
end
[Mean,Sem]=MATLAB.DataTypes.VarFun(@(Ensemble)MATLAB.DataFun.MeanSem(Ensemble,2),Data);
Mean=permute(Mean{:,:},[3,2,1]);
Sem=permute(Sem{:,:},[3,2,1]);
TimeRange=linspace(TimeRange(1),TimeRange(2),height(Mean)).';
for L=1:NumLanes
	Axes(end,L)=nexttile;
	Lines(:,L)=MATLAB.Graphics.MultiShadowedLines(Mean(:,:,L),Sem(:,:,L),1/3,EdgeColors=[1,0,0;0,0,1],X=TimeRange);
	if HasOptions(1)
		arrayfun(@xline,options.XLine.Time,options.XLine.LineStyle);
	end
	if HasOptions(2)
		arrayfun(@yline,options.YLine.Value,options.YLine.LineStyle);
	end
end
for L=2:NumLanes
	for E=1:NumRows
		Axes(E,L).YAxis.Visible=false;
	end
end
if numel(EnsembleSubtitles)>NumEnsembles
	ylabel(Axes(end,1),EnsembleSubtitles(end));
end
CLim=MATLAB.Graphics.UnifyAxesLims(Axes(1:NumEnsembles,:),@clim);
MATLAB.Graphics.UnifyAxesLims(Axes(end,:),@ylim);
[MinColor,MaxColor]=bounds(CLim);
LowColors=MATLAB.ElMat.LinSpace([0,0,1],[1,1,1],255);
colormap(gcf,[LowColors(uint8((1+MinColor/MaxColor)*255)+1:end,:);MATLAB.ElMat.LinSpace([1,1,1],[1,0,0],255).^2]);
ColorBar=colorbar(Axes(NumEnsembles,NumLanes));
end

